// src/components/MostSearchedWhisky.tsx
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import WhiskyCard from './WhiskyCard';
import './components.css';

const WeekTopSearch: React.FC = () => {
  const [whiskies, setWhiskies] = useState<Whisky[]>([]);

  useEffect(() => {
    // Fetch most searched whiskies from the API
    axios.get('/api/whisky')
      .then(response => {
        setWhiskies(response.data);
      })
      .catch(error => {
        console.error('Error fetching most searched whiskies:', error);
      });
  }, []);

  return (
    <section className="most-searched-whisky">
      <h2>주간 인기 위스키</h2>
      <div className="whisky-list">
        {whiskies.map(whisky => (
          <WhiskyCard key={whisky.id} whisky={whisky} />
        ))}
      </div>
    </section>
  );
};

export default WeekTopSearch;
